import React, { Component } from 'react'
import { Text, View, Image,Dimensions, TouchableOpacity,StyleSheet, TextInput, FlatList,ToastAndroid } from 'react-native'
import {Icon} from '@ant-design/react-native';
import { Actions } from 'react-native-router-flux';

const {width,scale,height}=Dimensions.get('window');
const w=width,h=height;
const imglist=[
    {
        img:require('../../images/box-1.png'),
        num:1,
        base:'data:image/png;base64,'
    },
    {
        img:require('../../images/box-2.png'),
        num:2,
        base:'data:image/png;base64,'
    },
    {
        img:require('../../images/box-3.png'),
        num:3,
        base:'data:image/png;base64,'
    },
    {
        img:require('../../images/box-4.png'),
        num:4,
        base:'data:image/png;base64,'
    },
    {
        img:require('../../images/box-5.png'),
        num:5,
        base:'data:image/png;base64,'
    },
    {
        img:require('../../images/box-6.png'),
        num:6,
        base:'data:image/png;base64,'
    }
]
export default class AddBox extends Component {
    constructor(){
        super();
        this.state={
            num:1,
            text:'',
            user:{}
        }
    }
    componentDidMount(){
        fetch('http://172.17.100.2:3000/users/my')
        .then((res)=>res.json())
        .then((res)=>{
            this.setState({
                user:res[0],
            })
        })
    }
    clickNum=(num1)=>{
        this.setState({
            num:num1
        },()=>{
            console.log(this.state.num)
        })
    }
    saveBox=()=>{
        var img1;
        for(var i=0;i<imglist.length;i++){
            if(imglist[i].num==this.state.num){
                img1=imglist[i].base;
            }
        }
        console.log(img1);
        let text1 = {text:this.state.text,img:img1} 
        let send1 = JSON.stringify(text1); 
        fetch(`http://172.17.100.2:3000/users/addbox`,{
            method: 'POST',
            headers: {'Content-Type': 'application/json; charset=utf-8'},
            body: send1
        })
        .then(res => res.json())
        .then(
            data => {
            }
        )
        let text = {userName:this.state.user.userName,updateTime:new Date(),taskId:1,taskContent:'添加盒子',taskScore:10,phone:this.state.user.userPhone} //获取数据
        let send = JSON.stringify(text);   //重要！将对象转换成json字符串
        fetch('http://172.17.100.2:3000/users/getscore',{   //Fetch方法y
            method: 'POST',
            headers: {'Content-Type': 'application/json; charset=utf-8'},
            body: send
        })
        .then(res => res.json())
        .then(
            res => {
                if(res.success){
                    ToastAndroid.show('添加盒子成功，积分+10',ToastAndroid.SHORT);
                    Actions.pop({refresh:{'key':res}});
                    this.props.change();
                }
                else{
                    ToastAndroid.show('添加盒子发生错误，请重新添加',ToastAndroid.SHORT);
                }
            }
        )

    }
    changeText=(text)=>{
        this.setState({
            text:text
        })
    }
    render() {
        return (
            <View style={{flex:1,width:w,height:h,justifyContent:'center',alignItems:'center',backgroundColor:'#fff'}}>
               <Image source={require('../../images/pic1.jpg')} style={{width:w,height:h*0.95,resizeMode:'stretch',position:'relative'}}/>
               <TouchableOpacity onPress={()=>{Actions.pop()}} style={{position:'absolute',right:40,top:60}}><Icon name='close' color="black"/></TouchableOpacity>
               <View style={{position:'absolute',top:'20%',width:'100%',alignItems:'center'}}>
                    <View style={styles.que}>
                        <Text style={{fontSize:27,marginRight:20}}>盒子名</Text>
                        <Image source={require('../../images/box-a1.png')} style={{position:'relative',width:'50%',height:h*0.2,resizeMode:'stretch'}}/>
                        <TextInput style={{left:w*0.40,top:10,position:'absolute',width:'45%',height:h*0.18,fontSize:16}} placeholder='请输入名称' multiline={true} autoFocus={true} onChangeText={(text)=>{this.changeText(text)}}/>
                    </View>
                    <View style={styles.que1}>
                        <Text style={{fontSize:27,marginRight:20,marginTop:10}}>盒子图片</Text>
                        <View style={{width:'55%',height:h*0.25}}>
                            {
                                [1].map((item)=>(
                                    <FlatList data={imglist} numColumns={3} renderItem={({item})=>{
                                        if(item.num==this.state.num){
                                            return (
                                                <TouchableOpacity style={{margin:10,borderColor:'#79be3b',borderWidth:2}} onPress={()=>{this.clickNum(item.num)}}><Image source={item.img} style={{width:w*0.13,height:h*0.07}}/></TouchableOpacity>
                                            )
                                        }
                                        else{
                                            return (
                                                <TouchableOpacity style={{margin:10}} onPress={()=>{this.clickNum(item.num)}}><Image source={item.img} style={{width:w*0.13,height:h*0.07}}/></TouchableOpacity>
                                            )
                                        }
                                    }}/>
                                ))
                            }
                        </View>
                    </View>
                    <TouchableOpacity style={styles.btn} onPress={()=>{this.saveBox()}}><Text style={{fontSize:20}}>保存</Text></TouchableOpacity>
               </View>
            </View>
        )
    }
}
const styles=StyleSheet.create({
    btn:{
        justifyContent:'center',
        alignItems:'center',
        width:'23%',
        height:h*0.06,
        backgroundColor:'#79be3b',
        borderRadius:7,
        marginTop:10
    },
    que:{
        flexDirection:'row',
        width:'100%',
        justifyContent:'center',
        alignItems:'center',
        marginBottom:30
    },
    que1:{
        flexDirection:'row',
        width:'100%',
        justifyContent:'center',
        marginBottom:30
    }
})